INSERT INTO `periode` (`id_periode`, `id_kuesioner`, `deskripsi`, `deskripsi_detail`, `waktu_min`, `waktu_maks`, `respondent_id`, `generator_config`, `separator`, `custom_data_format`, `custom_data2_format`, `custom_data3_format`, `data_helper`, `tabel_jawaban`, `tabel_jawaban_header`) VALUES
(3, 2, 'Survey Kepuasan Mahasiswa 2014/2015</td><td>', 'Survey Kepuasan Mahasiswa 2014/2015 Ganjil', '2014-02-24 17:00:00', '2014-04-02 17:00:00', 'sisfo_get_username()', 'db="sisfo";sql="SELECT m.MhswID FROM mhsw m WHERE m.Login = ''{respondent_id}''"', '&&', '{MhswID}', NULL, NULL, NULL, 'edom_20131_j', 'edom_20131_jh'),
(9, 1, '{MKNama}<sup>{MKKode}</sup></td><td>{DosenNama}', '20131', '2014-01-31 17:00:00', '2014-04-25 16:59:59', 'sisfo_get_username()', 'db="sisfo";sql="SELECT a.KRSID, a.KodeID, a.KHSID, a.MhswID, a.TahunID, a.JadwalID,\na.MKID,\na.DosenID, a.DosenNama AS DosenNama,\na.MKKode AS MKKode, a.MKNama AS MKNama, a.order_no, a.is_same\nFROM (\nSELECT k.KRSID, k.KodeID, k.KHSID, k.MhswID, k.TahunID, k.JadwalID,\nj.MKID,\nd.Login AS DosenID, d.Nama AS DosenNama,\nUPPER(mk.MKKode) AS MKKode, UPPER(mk.Nama) AS MKNama, 1 AS order_no, -1 AS is_same\nFROM krs k\nLEFT OUTER JOIN jadwal j ON (k.JadwalID = j.JadwalID AND k.KodeID = j.KodeID)\nLEFT OUTER JOIN dosen d ON (j.DosenID = d.Login AND k.KodeID = j.KodeID)\nLEFT OUTER JOIN mk mk ON (j.MKID = mk.MKID AND k.KodeID = j.KodeID)\nWHERE k.NA = ''N''\nAND k.JadwalID <> 0\nAND k.TahunID = ''20131''\nAND k.MhswID = ''{respondent_id}''\nUNION\nSELECT k.KRSID, k.KodeID, k.KHSID, k.MhswID, k.TahunID, k.JadwalID,\nj.MKID,\nIF(ISNULL(jd.DosenID), d.Login, jd.DosenID) AS DosenID, IF(ISNULL(jd.DosenID), d.Nama, dd.Nama) AS DosenNama,\nUPPER(mk.MKKode) AS MKKode, UPPER(mk.Nama) AS MKNama, 2 AS order_no, IF(ISNULL(jd.DosenID), 1, 0) AS is_same\nFROM krs k\nLEFT OUTER JOIN jadwal j ON (k.JadwalID = j.JadwalID AND k.KodeID = j.KodeID)\nLEFT OUTER JOIN dosen d ON (j.DosenID = d.Login AND k.KodeID = j.KodeID)\nLEFT OUTER JOIN mk mk ON (j.MKID = mk.MKID AND k.KodeID = j.KodeID)\nLEFT OUTER JOIN jadwaldosen jd ON k.JadwalID = jd.JadwalID\nLEFT OUTER JOIN dosen dd ON (jd.DosenID = dd.Login AND k.KodeID = dd.KodeID)\nWHERE k.NA = ''N''\nAND k.JadwalID <> 0\nAND k.TahunID = ''20131''\nAND k.MhswID = ''{respondent_id}''\n) a\nORDER BY a.MKNama, a.order_no, a.DosenNama"', '&&', '{TahunID}&&{KRSID}&&{KodeID}&&{KHSID}&&{JadwalID}&&{DosenID}', '{order_no}', '{_CODE_SET_edom_timing}', '{is_same}&&{MKNama}&&{DosenNama}', 'edom_20131_j', 'edom_20131_jh');
